import { useState, useEffect } from "react";
import axios from "axios";

function Map() {
    const [map, setMap ] = useState([]);

    // https://api.mapbox.com/styles/v1/{username}/{style_id}/static/{overlay}/{lon},{lat},{zoom},{bearing},{pitch}|{auto}|{bbox}/{width}x{height}{padding}{@2x}
    // https://api.mapbox.com/styles/v1/ideviotllc/outdoors-v11/static/-122.3486,37.8169,9,0/300x200?access_token=     
    // pk.eyJ1IjoiaWRldmlvdGxsYyIsImEiOiJjbGd3cHI3Nm8wMGYwM3NuNmc4MndheWQwIn0.2Yh2XU47c-9dbdTBeReiSw
    const mapboxAccessToken = "pk.eyJ1IjoiaWRldmlvdGxsYyIsImEiOiJjbGd3cHI3Nm8wMGYwM3NuNmc4MndheWQwIn0.2Yh2XU47c-9dbdTBeReiSw";

    let lat = "37.8169";
    let lon = "-122.3486";

    useEffect(() => {
        const getMap = async () => {
            const response = await axios.get(`https://api.mapbox.com/styles/v1/ideviotllc/outdoors-v11/static/pin-s+555555(-122.3486,${lat})/${lon},${lat},14,0/300x200?access_token=${mapboxAccessToken}`);

            setMap(response.data);
        }
        console.log("I'm getting the map")
        getMap();
    }, [])

// console.log(map)

    return (
        <div>
            {map}
        </div>
    )
}

export default Map;
